import React from 'react';

import { ProductList, IconBentcare, Button } from '@bentcare/core';
import { Container, Content } from '../../styles/styles';

const Product: React.FC = () => {
  return (
    <Container>
      <Content>
        <ProductList
          icon={<IconBentcare icon="exam" />}
          title="Exames"
          products={[
            {
              description: 'Vitamina D-25 Hidroxi',
              price: '46,80',
            },
            {
              description: 'TSH - Hormônio',
              price: '14,40',
            },
            {
              description: 'Glicose',
              price: '5,40',
            },
            {
              description: 'Hemograma Completo',
              price: '9,00',
            },
            {
              description: 'Colesterol Total',
              price: '25,20',
            },
          ]}
        />
        <Button appearance="primary" fullWidth label="Ver todos exames" />
      </Content>
    </Container>
  );
};

export default Product;
